  - uid: 1598
    components:
    - type: MetaData
      name: paper- 'A Crash Course in Legal SOP on SS13'
    - type: Transform
      pos: 57.5,17.5
      parent: 2
    - type: Paper
      content: >-
        [bold]Roles:[/bold]

        The Forensic Technician is basically the investigator and prosecutor.

        The Staff Assistant can perform these functions with written authority from the Forensic Technician.

        The Captain/HoP/Warden is ct as the judicial authority.

        The Security Officers are responsible for executing warrants, security during trial, and prisoner transport.


        [bold]Investigative Phase:[/bold]

        After the crime has been committed the Forensic Technician's job is to gather evidence and try to ascertain not only who did it but what happened. He must take special care to catalogue everything and don't leave anything out. Write out all the evidence on paper. Make sure you take an appropriate number of fingerprints. IF he must ask someone questions he has permission to confront them. If the person refuses he can ask a judicial authority to write a subpoena for questioning. If again he fails to respond then that person is to be jailed as insubordinate and obstructing justice. Said person will be released after he cooperates.


        ONCE the FT has a clear idea as to who the criminal is he is to write an arrest warrant on the piece of paper. IT MUST LIST THE CHARGES. The FT is to then go to the judicial authority and explain a small version of his case. If the case is moderately acceptable the authority should sign it. Security must then execute said warrant.


        [bold]Pre-Pre-Trial Phase:[/bold]

        Now a legal representative must be presented to the defendant if said defendant requests one. That person and the defendant are then to be given time to meet (in the jail IS ACCEPTABLE). The defendant and his lawyer are then to be given a copy of all the evidence that will be presented at trial (rewriting it all on paper is fine). THIS IS CALLED THE DISCOVERY PACK. With a few exceptions, THIS IS THE ONLY EVIDENCE BOTH SIDES MAY USE AT TRIAL. IF the prosecution will be seeking the death penalty it MUST be stated at this time. ALSO if the defense will be seeking not guilty by mental defect it must state this at this time to allow ample time for examination.

        Now at this time each side is to compile a list of witnesses. By default, the defendant is on both lists regardless of anything else. Also the defense and prosecution can compile more evidence beforehand BUT in order for it to be used the evidence MUST also be given to the other side.

        The defense has time to compile motions against some evidence here.

        [bold]Possible Motions:[/bold]

        1. [italic]Invalidate Evidence-[/italic] Something with the evidence is wrong and the evidence is to be thrown out. This includes irrelevance or corrupt security.

        2. [italic]Free Movement-[/italic] Basically the defendant is to be kept uncuffed before and during the trial.

        3. [italic]Subpoena Witness-[/italic] If the defense presents god reasons for needing a witness but said person fails to cooperate then a subpoena is issued.

        4. [italic]Drop the Charges-[/italic] Not enough evidence is there for a trial so the charges are to be dropped. The FT CAN RETRY but the judicial authority must carefully reexamine the new evidence.

        5. [italic]Declare Incompetent-[/italic] Basically the defendant is insane. Once this is granted a medical official is to examine the patient. If he is indeed insane he is to be placed under care of the medical staff until he is deemed competent to stand trial.


        ALL SIDES MOVE TO A COURTROOM

        [bold]Pre-Trial Hearings:[/bold]

        A judicial authority and the 2 sides are to meet in the trial room. NO ONE ELSE BESIDES A SECURITY DETAIL IS TO BE PRESENT. The defense submits a plea. If the plea is guilty then proceed directly to sentencing phase. Now the sides each present their motions to the judicial authority. He rules on them. Each side can debate each motion. Then the judicial authority gets a list of crew members. He first gets a chance to look at them all and pick out acceptable and available jurors. Those jurors are then called over. Each side can ask a few questions and dismiss jurors they find too biased. HOWEVER before dismissal the judicial authority MUST agree to the reasoning.


        [bold]The Trial:[/bold]

        The trial has three phases.

        1. [bold]Opening Arguments[/bold]- Each side can give a short speech. They may not present ANY evidence.

        2. [bold]Witness Calling/Evidence Presentation[/bold]- The prosecution goes first and is able to call the witnesses on his approved list in any order. He can recall them if necessary. During the questioning the lawyer may use the evidence in the questions to help prove a point. After every witness the other side has a chance to cross-examine. After both sides are done questioning a witness the prosecution can present another or recall one (even the EXACT same one again!). After prosecution is done the defense can call witnesses. After the initial cases are presented both sides are free to call witnesses on either list.

        FINALLY once both sides are done calling witnesses we move onto the next phase.

        3. [bold]Closing Arguments[/bold]- Same as opening.

        The jury then deliberates IN PRIVATE. THEY MUST ALL AGREE on a verdict. REMEMBER: They mix between some charges being guilty and others not guilty (IE if you supposedly killed someone with a gun and you unfortunately picked up a gun without authorization then you CAN be found not guilty of murder BUT guilty of possession of illegal weaponry.). Once they have agreed they present their verdict. If unable to reach a verdict and feel they will never they call a deadlocked jury and we restart at Pre-Trial phase with an entirely new set of jurors.


        [bold]Sentencing Phase:[/bold]

        If the death penalty was sought (you MUST have gone through a trial for death penalty) then skip to the second part. 

        I. Each side can present more evidence/witnesses in any order. There is NO ban on emotional aspects or anything. The prosecution is to submit a suggested penalty. After all the sides are done then the judicial authority is to give a sentence.

        II. The jury stays and does the same thing as I. Their sole job is to determine if the death penalty is applicable. If NOT then the judge selects a sentence.


        TADA you're done. Security then executes the sentence and adds the applicable convictions to the person's record.
