        Blue- Emergency

        [bullet]1. Caused by fire

        [bullet]2. Caused by manual interaction

        [bullet]Action:

        [bullet][bullet]Close all fire doors. These can only be opened by reseting the alarm

        Red- Ejection/Self Destruct

        [bullet]1. Caused by module operating computer.

        [bullet]Action:

        [bullet][bullet]After the specified time the module will eject completely.


        Engine Maintenance Instructions:

        [bullet]Shut off ignition systems:

        [bullet]Activate internal power

        [bullet]Activate orbital balance matrix

        [bullet]Remove volatile liquids from area

        [bullet]Wear a fire suit


        [bullet]After

        [bullet][bullet]Decontaminate

        [bullet][bullet]Visit medical examiner


        Toxin Laboratory Procedure:

        [bullet]Wear a gas mask regardless

        [bullet]Get an oxygen tank.

        [bullet]Activate internal atmosphere


        [bullet]After

        [bullet][bullet]Decontaminate

        [bullet][bullet]Visit medical examiner


        Disaster Procedure:

        [bullet]Fire:

        [bullet]Activate sector fire alarm.

        [bullet]Move to a safe area.

        [bullet]Get a fire suit

        [bullet][bullet]After:

        [bullet][bullet][bullet]Assess Damage

        [bullet][bullet][bullet]Repair damages

        [bullet][bullet][bullet]If needed, Evacuate

        [bullet]Meteor Shower:

        [bullet][bullet]Activate fire alarm

        [bullet][bullet]Move to the back of ship

        [bullet][bullet]After

        [bullet][bullet][bullet]Repair damage

        [bullet][bullet][bullet]If needed, Evacuate

        [bullet]Accidental Reentry:

        [bullet][bullet]Activate fire alrms in front of ship.

        [bullet][bullet]Move volatile matter to a fire proof area!

        [bullet][bullet]Get a fire suit.

        [bullet][bullet]Stay secure until an emergency ship arrives.


        [bullet][bullet]If ship does not arrive-

        [bullet][bullet][bullet]Evacuate to a nearby safe area!
