        Grade A Semi-Liquid Plasma:

        [bullet][bullet]Highly poisonous. You cannot sustain concentrations above 15 units.

        [bullet][bullet]A gas mask fails to filter plasma after 50 units.

        [bullet][bullet]Will attempt to diffuse like a gas.

        [bullet][bullet]Filtered by scrubbers.

        [bullet][bullet]There is a bottled version which is very different

        [bullet][bullet][bullet]from the version found in canisters!


        [bullet][bullet]WARNING: Highly Flammable. Keep away from heat sources

        [bullet][bullet]except in a enclosed fire area!

        [bullet][bullet]WARNING: It is a crime to use this without authorization.

        Known Onboard Anti-Toxin:

        [bullet]Anti-Toxin Type 01P: Works against Grade A Plasma.

        [bullet][bullet]Best if injected directly into bloodstream.

        [bullet][bullet]A full injection is in every regular Med-Kit.

        [bullet][bullet]Special toxin Kits hold around 7.


        Known Onboard Chemicals (other):

        [bullet]Rejuvenation T#001:

        [bullet][bullet]Even 1 unit injected directly into the bloodstream

        [bullet][bullet][bullet]will cure paralysis and sleep toxins.

        [bullet][bullet]If administered to a dying patient it will prevent

        [bullet][bullet][bullet]further damage for about units*3 seconds.

        [bullet][bullet][bullet]it will not cure them or allow them to be cured.

        [bullet][bullet]It can be administeredd to a non-dying patient

        [bullet][bullet][bullet]but the chemicals disappear just as fast.

        [bullet]Sleep Toxin T#054:

        [bullet][bullet]5 units wilkl induce precisely 1 minute of sleep.

        [bullet][bullet][bullet]The effects are cumulative.

        [bullet][bullet]WARNING: It is a crime to use this without authorization
